import React, { Component } from "react";
import "./tabs";
import Tab from "./tab/tab";
function Tabs(tabs) {
  var shortid = require("shortid");
  return (
    // <div className="tabs">
    tabs.map((tab, index) => (
      <Tab key={shortid.generate()} tab={tab} index={index}></Tab>
    ))
    //  </div>
  );
}
export default Tabs;
